Учитывая входную строку s, измените порядок слов на противоположный. Слово определяется как последовательность не пробельных символов. Слова в s будут разделены хотя бы одним пробелом. Возвращает строку слов в обратном порядке, объединенных одним пробелом. Обратите внимание, что s может содержать начальные или конечные пробелы или несколько пробелов между двумя словами. Возвращаемая строка должна содержать только один пробел, разделяющий слова. Не включайте никаких дополнительных пробелов
